import React, { useState } from "react";

const BlogList = ({ title }) => {
  const [blogs, setBlogs] = useState([
    { title: "My blogs 1", body: "lorem ipsum", author: "mario", id: 1 },
    { title: "My blogs 2", body: "lorem ipsum", author: "mario", id: 2 },
    { title: "My blogs 3", body: "lorem ipsum", author: "mario", id: 3 },
    { title: "My blogs 4", body: "lorem ipsum", author: "mario", id: 4 },
  ]);

  return (
    <div>
      <h1>{title}</h1>
      {blogs.map((index) => (
        <div>
          <h1>{index.title}</h1>
        </div>
      ))}
    </div>
  );
};

export default BlogList;
